description:
Reduce storage costs through disk space analysis &amp; management.

Desktop PCs and servers can quickly end up accumulating large quantities of unused, temporary, and duplicate files. Before you know it, you're out of drive space, backups are taking far too long to run, and users can't find the data they need when they need it.

You need a visual, interactive software tool to help you manage disk space usage. You need FolderSizes. FolderSizes is an award-winning, network-enabled disk space analysis tool. It can quickly isolate large, old, temporary, and duplicate files, or even show file distribution by type, attributes, or owner. All with multiple export formats, command-line support, shell context menu integration, and much more.
